import { Link } from "react-router-dom";
import style from "./Headerfile.module.css"
function Header(){
    return(<div className={style.header}>
        <h1 className={style.users}>Hello {localStorage.getItem("username")}</h1>
        <h1 className={style.titles}>TODO LIST</h1>
        <Link to="/" className={style.logouBtn}>
            Log Out
          </Link>
    </div>)
} 
export default Header;
